function getAge (currentDate, startDate) {
	const age = Math.floor((currentDate.getTime() - (new Date(startDate)).getTime()) / 31557600000);
		// 31557600000 is 24 * 3600 * 365.25 * 1000 which is the length of a year
	return age;
}


